import React from "react";

function EventCard( { currentEvent } ) {
  console.log(currentEvent.setup)
  // console.log()
  const choices = currentEvent.choices.map(choice => <p>{choice}</p>)

  return (
    <div className="event-div">
      <p>{currentEvent.setup}</p>
      {choices}
    </div>
  )
}

export default EventCard
